import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to a category page to access price filter
    await page.click('a:has-text("Electronics")');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Wait for and apply price range filter
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.fill('#minPrice', '100');
    await page.fill('#maxPrice', '500');
    await page.click('.apply-filter');

    // Wait for filter to be applied and products to update
    await page.waitForTimeout(2000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract product prices to verify filter was applied
    const prices = await page.$$eval('.product-price', elements => 
      elements.map(el => {
        const priceText = el.textContent.replace('$', '');
        return parseFloat(priceText);
      })
    );

    // Verify all prices are within the applied range
    const allInRange = prices.every(price => price >= 100 && price <= 500);

    return {
      success: true,
      action: "Applied price range filter of $100-$500 to electronics category",
      extractedData: {
        prices: prices,
        allPricesInRange: allInRange,
        minPrice: Math.min(...prices),
        maxPrice: Math.max(...prices)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
